r a bigger stage than the Moon Theater. The Crystal Tower Theater in the glamorous big city would be perfect - but there's one small problem. Actually, three. First, Buster Moon, mother pig Rosita, rocker porcupine Ash, elephant Meena, gorilla Johnny and pop provocateur, pig Gunter, must somehow make it to the office of music mogul Jimmy Crystal and convince the unscrupulous wolf to let them use his theater. It's a hopeless endeavor until Gunter spontaneously promises him the scoop: rock legend Clay Calloway (Bono) will return to the stage for this show! The problem: Buster has never met Clay, a lion who has retired from show business! While Moon's all-star ensemble works to put on the spectacular show, the koala sets out to find Clay. What begins as a dream of great success becomes an emotional reminder of the healing power of music.\n\n¬© Universal Pictures\n\nBuster Moon, and his all-star cast of performers prepare to launch their most dazzling stage extravaganza yet ‚Ä¶all in the glittering entertainment capital of the world. There‚Äôs just one hitch: They first have to persuade the world‚Äôs most reclusive rock star‚Äîplayed by global music icon Bono, in his animated film debut‚Äîto join them.\n \nBuster (Oscar¬Æ winner Matthew McConaughey) has turned the New Moon Theater into a local hitbut Buster has his eyes on a bigger prize: Debuting a new show at the Crystal Tower Theater in glamorous Redshore City.\n \nBut with no connections, Buster and his cast‚Äîincluding harried mother pig Rosita (Oscar¬Æ winner Reese Witherspoon), rocker porcupine Ash (Scarlett Johansson), earnest gorilla Johnny (Taron Egerton), shy elephant Meena (Tori Kelly) and, of course, porcine provocateur Gunter (Nick Kroll)‚Äîhave to sneak their way into the world-famous Crystal Entertainment offices, run by ruthless mogul wolf Jimmy Crystal (Emmy winner Bobby Cannavale).\n \nIn a desperate attempt to get Mr. Crystal‚Äôs attention, Gunter spontaneously pitches an outrageous idea that Buster 