        "title": "Quantum Physics: Here‚Äôs Why Movies Always Get It Wrong",
        "description": "Quantum physics deals with the foundation of our world ‚Äì the electrons in an atom, the protons inside the nucleus, the quarks that build those protons, and the photons that we perceive as light. These constitute everything that we are made of, both matter and energy. But how is it any different from regular physics? The 'regular' physics is the physics that deals with Newton‚Äôs laws of motion and its related mechanics. This is more formally called Classical Physics.\n\nThis is the physics of our day-to-day lives‚Äîthe rolling of balls, the rotation of the earth, and the mechanics of engines. Quantum physics deals with particles that are incredibly small and hence, the laws of classical physics don‚Äôt apply in this world. In this video, we discuss the meaning of quantum physics and how is it going to change how we perceive the world around us.\n\n#quantumphysics #quantummechanics #quantumworld\n\nReferences:\nhttps://scienceexchange.caltech.edu/topics/quantum-science-explained/quantum-physics\nhttps://www.insidescience.org/second-quantum-revolution/quantum-history\nhttps://link.springer.com/chapter/10.1007/978-94-010-1440-3_7\n\nSUBSCRIBE to get more such science videos! \nhttps://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\nFollow us on Twitter! \nhttps://twitter.com/abc_science\n\nFollow us on Facebook!\nhttps://facebook.com/sciabc\n\n\nFollow us on Instagram!\nhttps://www.instagram.com/scienceabcofficial/ \n\nFollow us on LinkedIn!\nhttps://www.linkedin.com/company/scienceabc\n\nFollow our Website!\nhttps://www.scienceabc.com",
