        "description": "Follow two astronauts into outer space to explore time dilation and Einstein‚Äôs theory of relativity through the Twin Paradox thought experiment. \n\n--\n\nOn their 20th birthday, identical twin astronauts volunteer for an experiment. Terra will remain on Earth, while Stella will board a spaceship. Stella‚Äôs ship will travel to visit a star that is 10 light-years away, then return to Earth. As they prepare to part ways, the twins wonder what will happen when they‚Äôre reunited. Who will be older? Amber Stuver investigates the ‚ÄúTwin Paradox.‚Äù\n\nLesson by Amber Stuver, directed by Aim Creative Studios.\n\nSign up for our newsletter: http://bit.ly/TEDEdNewsletter\nSupport us on Patreon: http://bit.ly/TEDEdPatreon\nFollow us on Facebook: http://bit.ly/TEDEdFacebook\nFind us on Twitter: http://bit.ly/TEDEdTwitter\nPeep us on Instagram: http://bit.ly/TEDEdInstagram\nView full lesson: https://ed.ted.com/lessons/einstein-s-twin-paradox-explained-amber-l-stuver\n\nThank you so much to our patrons for your support! Without you this video would not be possible! Rare Media, Rayo, Faizan, Elizabeth Gu, Nazmul Idris, Po Foon Kwong, Siobhan O'Connor Gwozdz, NinjaBoffin, Jesse Jurman, Josue Perez Miranda, Jan-Erik, Scott Markley, Kaitlyn holland, Elija Peterson, Michele Lynn Rose, Jai Prasanth, Vack91, David Lucsanyi, Xavier dupont, Marisa Miller, Boytsov Ilya, Steven Razey, Javier Aldavaz, Nathan Giusti, Mada Arslan, Joichiro Yamada, Ritul Raghavan, Aline de Paula Zillig, Yambu Ganesh Shaw, Abeer Rajbeen, John Hong, Minh Tran, Helen Lee, Anthony Benedict, Turine Tran, Mathew Samuel, Karthik Balsubramanian, Lee, Livia-Alexandra Sarban, Annastasshia Ames, Jo√£o Henrique Rodrigues, Sebastiaan Hols, Aries SW, SANG HAN, Amy Lopez, ReuniteKorea, Vinh-Thuy Nguyen, Liz Candee, Clovis Norroy and Danielle Downs.",
