        "title": "The Speed of Light is NOT About Light",
        "description": "Sign Up on Patreon to get access to the Space Time Discord! \nhttps://www.patreon.com/pbsspacetime\n\nSign up for the mailing list to get episode notifications and hear special announcements!\nhttps://mailchi.mp/1a6eb8f2717d/spacetime\n\nCheck out the Space Time Merch Store\nhttps://pbsspacetime.com/\n\nHelp translate our videos! http://www.youtube.com/timedtext_cs_panel?tab=2&c=UC7_gcs09iThXybpVgjHZ_7g\n\nThe speed of light is often cited as the fastest anything can travel in our universe.  While this might be true, the speed of light is the EFFECT and not the CAUSE of this phenomenon.  So what's the cause?  On this week's episode of Space Time, Matt helps explain what the speed of light REALLY is and why it‚Äôs the cosmic speed limit of our universe!\n\n\"The Real Meaning of E=mc¬≤\":\nhttps://www.youtube.com/watch?v=Xo232kyTsO0\n\n\"Are Space And Time An Illusion?\":\nhttps://www.youtube.com/watch?v=YycAzdtUIko\n\n----------------------------------------\u00ad\u00ad---------\n\nSOURCES:\n\nEinstein's derivation or the Lorentz transformation from the invariant speed of light:\nEinstein, Albert (1916) \"Relativity: The Special and General Theory\"\nhttp://www.archive.org/stream/cu31924011804774#page/n159/mode/2up\n\nLorentz Transformation without invariant speed of light, from relativity, isotropy, and consistency of frame transitions (closure group postulate):\nvon Ignatowsky, ‚ÄúDas Relativitatsprinzip,‚Äù Archiv der Mathematik und Physik 17, 1‚Äì24 (1911)\n\nBerzi1 & Gorini, J. Math. Phys. 10, 1518 (1969)\nhttp://dx.doi.org/10.1063/1.1665000\n\nPelissetto & Testa, American Journal of Physics, 83, 338, (2015) \"Getting the Lorentz transformations without requiring an invariant speed\"\nhttp://arxiv.org/abs/1504.02423\n\nhttps://en.wikipedia.org/wiki/Derivations_of_the_Lorentz_transformations\n\n----------------------------------------\u00ad\u00ad---------\n\nCOMMENTS:\n\nDenny Hiu\nhttps://www.youtube.com/watch?v=AwwIFcdUFrE&lc=z124w3dhotm